import { ExampleItemContainer } from "./styles"

const ExampleItem = () => {
    return (
        <ExampleItemContainer>
            <p>Name</p>
            <p>Surname</p>
            <p>Role</p>
            <p>Date of Birth</p>
            <p>Remove</p>
        </ExampleItemContainer>
    )
}

export default ExampleItem;
